/* Theme: sunsetOrange */
@theme reference {
  --color-sunsetOrange-background: 0 0% 100%;
  --color-sunsetOrange-foreground: 0 0% 3.9%;
  --color-sunsetOrange-card: 0 0% 100%;
  --color-sunsetOrange-card-foreground: 0 0% 3.9%;
  --color-sunsetOrange-popover: 0 0% 100%;
  --color-sunsetOrange-popover-foreground: 0 0% 3.9%;
  --color-sunsetOrange-primary: 25 95% 53%;
  --color-sunsetOrange-primary-foreground: 0 0% 98%;
  --color-sunsetOrange-secondary: 33 100% 96%;
  --color-sunsetOrange-secondary-foreground: 0 0% 9%;
  --color-sunsetOrange-muted: 210 40% 96%;
  --color-sunsetOrange-muted-foreground: 0 0% 45.1%;
  --color-sunsetOrange-accent: 32 98% 83%;
  --color-sunsetOrange-accent-foreground: 0 0% 9%;
  --color-sunsetOrange-destructive: 0 72% 51%;
  --color-sunsetOrange-destructive-foreground: 0 0% 100%;
  --color-sunsetOrange-border: 214 32% 91%;
  --color-sunsetOrange-input: 214 32% 91%;
  --color-sunsetOrange-ring: 25 95% 53%;
}

.theme-sunsetOrange {
  --color-background: var(--color-sunsetOrange-background);
  --color-foreground: var(--color-sunsetOrange-foreground);
  --color-card: var(--color-sunsetOrange-card);
  --color-card-foreground: var(--color-sunsetOrange-card-foreground);
  --color-popover: var(--color-sunsetOrange-popover);
  --color-popover-foreground: var(--color-sunsetOrange-popover-foreground);
  --color-primary: var(--color-sunsetOrange-primary);
  --color-primary-foreground: var(--color-sunsetOrange-primary-foreground);
  --color-secondary: var(--color-sunsetOrange-secondary);
  --color-secondary-foreground: var(--color-sunsetOrange-secondary-foreground);
  --color-muted: var(--color-sunsetOrange-muted);
  --color-muted-foreground: var(--color-sunsetOrange-muted-foreground);
  --color-accent: var(--color-sunsetOrange-accent);
  --color-accent-foreground: var(--color-sunsetOrange-accent-foreground);
  --color-destructive: var(--color-sunsetOrange-destructive);
  --color-destructive-foreground: var(--color-sunsetOrange-destructive-foreground);
  --color-border: var(--color-sunsetOrange-border);
  --color-input: var(--color-sunsetOrange-input);
  --color-ring: var(--color-sunsetOrange-ring);
}

@media (prefers-color-scheme: dark) {
  .theme-sunsetOrange {
    --color-background: 240 10% 3.9%;
    --color-foreground: 0 0% 98%;
    --color-card: 240 10% 3.9%;
    --color-card-foreground: 0 0% 98%;
    --color-popover: 240 10% 3.9%;
    --color-popover-foreground: 0 0% 98%;
    --color-primary: 25 95% 90%;
    --color-primary-foreground: 240 5.9% 10%;
    --color-secondary: 240 3.7% 15.9%;
    --color-secondary-foreground: 0 0% 98%;
    --color-muted: 240 3.7% 15.9%;
    --color-muted-foreground: 240 5% 64.9%;
    --color-accent: 32 98% 23%;
    --color-accent-foreground: 0 0% 98%;
    --color-destructive: 0 62.8% 30.6%;
    --color-destructive-foreground: 0 0% 98%;
    --color-border: 240 3.7% 15.9%;
    --color-input: 240 3.7% 15.9%;
    --color-ring: 25 95% 90%;
  }
}

